import classes from './Cart.module.css';
import Modal from '../UI/Modal';

const Cart = (props) => {
    const cartItems = (
    <ul className={classes['cart-items']}>
        {[{
        id: 'c1',
        name: 'sushi',
        amount: 2,
        price: 12.99,
        }].map((item) => (
        <li>{item.name}</li>
        ))}
    </ul>
    );

    return(
       <Modal>
            {cartItems}
            <div className={classes.total}>
                <span>Total Amount</span>
                <span>43.45</span>
            </div>
            <div className={classes.actions}>
                <button onClick={props.onClose} className={classes['btn--alt']}>Close</button>
                <button className={classes.button}>Order</button>
            </div>
        </Modal>
    )
}
export default Cart;
